description:
A wrong self variable was used for decreases clauses, hence loop contracts using class variables in their decreases clause could not be proved due to non-matching self variables.
E.g., the following example was not provable, however valid.

```java
public class Foo {

  /*@ public invariant 0 <= foo; @*/

  public int foo;

  /*@ public normal_behavior
    @ requires foo == 1;
    @ assignable foo;
    @ ensures foo == 0;
    @*/
  public void foo() {
  /*@ loop_contract normal_behavior
    @ requires 0 <= foo;
    @ assignable foo;
    @ ensures foo == 0;
    @ decreases foo;
    @*/
    {
      while (0 < foo) {
        foo = 0;
      }
    }
  }
}
```

A high-level interface for KeY should lower the obstacles to use the key system in third-party systems, like ProofScriptDebugger or AlgoVer. 

